import React from 'react';
import './header.css';
import logo from './assets/logo.png';

function Header() {
    return (
        <header className="header">
            <div className="logo">
                <img src={logo} alt="Logo" />
            </div>
            <nav className="nav">
                <a href="#home">Home</a>
                <a href="#about">About</a>
                <a href="#services">Services</a>
                <a href="#pricing">Pricing</a>
                <a href="#blog">Blog</a>
            </nav>
        </header>
    );
}

export default Header;
